import React, { Component } from "react";
import { Helmet } from "react-helmet";

class Result extends Component {
  render() {
    return (

        <Helmet>
         <div className="application"> 
          <script
            async
            src="https://widget.budgetyourtrip.com/location-widget-js/US"
            type="text/javascript"
          />
          <a
            href="https://www.budgetyourtrip.com/united-states-of-america"
            target="_blank"
            class="budgetyourtrip-logo-pushdown"
            rel="noopener"
          >
            United States of America Travel Costs
          </a> 

      </div>
        </Helmet>

    );
  }
}

export default Result;
